// src/pages/EditarPet.jsx
import React, { useEffect, useState } from 'react';
import { useNavigate, useParams, Link } from 'react-router-dom';
import api from '../../services/api';

export default function EditarPet() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [pet, setPet] = useState({});

  useEffect(() => {
    api.get(`/pets/${id}`)
      .then(response => setPet(response.data))
      .catch(error => console.error('Erro ao buscar pet:', error));
  }, [id]);

  const handleChange = e => {
    const { name, value, type, checked } = e.target;
    const newValue = type === 'checkbox' ? checked : value;
    setPet({ ...pet, [name]: newValue });
  };

  const handleSubmit = e => {
    e.preventDefault();
    api.put(`/pets/${id}`, pet)
      .then(() => navigate(`/pets/${id}`))
      .catch(error => console.error('Erro ao atualizar pet:', error));
  };

  return (
    <div className="container my-5">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>Editar Pet</h2>
        <Link to="/" className="btn btn-outline-secondary">← Voltar ao Início</Link>
      </div>

      <form onSubmit={handleSubmit}>
        {['nome', 'raca', 'idade', 'peso', 'porte', 'sexo', 'cor', 'observacoes'].map(campo => (
          <div className="mb-3" key={campo}>
            <label className="form-label">{campo.charAt(0).toUpperCase() + campo.slice(1)}:</label>
            <input name={campo} className="form-control" value={pet[campo] || ''} onChange={handleChange} />
          </div>
        ))}

        <div className="form-check mb-3">
          <input className="form-check-input" type="checkbox" name="castrado" checked={pet.castrado || false} onChange={handleChange} />
          <label className="form-check-label">Castrado</label>
        </div>

        <div className="form-check mb-3">
          <input className="form-check-input" type="checkbox" name="carteiraVacinacao" checked={pet.carteiraVacinacao || false} onChange={handleChange} />
          <label className="form-check-label">Carteira de Vacinação em Dia</label>
        </div>

        <div className="mb-3">
          <label className="form-label">Tutor:</label>
          <input name="tutor" className="form-control" value={pet.tutor?.nome || ''} readOnly />
        </div>

        <div className="mb-3">
          <label className="form-label">Dono:</label>
          <input name="dono" className="form-control" value={pet.dono?.nome || ''} readOnly />
        </div>

        <div className="mb-3">
          <label className="form-label">Criador (Admin):</label>
          <input name="admin" className="form-control" value={pet.admin?.nome || ''} readOnly />
        </div>

        <button type="submit" className="btn btn-primary">Salvar Alterações</button>
      </form>
    </div>
  );
}
